import { Grid, Toolbar, Typography } from "@mui/material";

const Footer = () => {
  return (
    <>
      <Toolbar
        position="static"
        sx={{ width: "90%", m: "0 auto", borderBottom: "1px solid #b6b6b6" }}
      >
        <Grid container minHeight={100}>
          <Grid
            display="flex"
            flexGrow={1}
            justifyContent="center"
            sx={{ mt: 8 }}
          >
            로고 넣기
          </Grid>
        </Grid>
      </Toolbar>
      <Toolbar sx={{ width: "90%", m: "0 auto" }}>
        <Grid
          container
          display="flex"
          minHeight={100}
          justifyContent="center"
          alignItems="center"
        >
          <Grid
            mx={2}
            minHeight={10}
            minWidth={10}
            sx={{ border: "1px solid" }}
          ></Grid>
          <Grid
            mx={2}
            minHeight={10}
            minWidth={10}
            sx={{ border: "1px solid" }}
          ></Grid>
          <Grid
            mx={2}
            minHeight={10}
            minWidth={10}
            sx={{ border: "1px solid" }}
          ></Grid>
          <Grid
            mx={2}
            minHeight={10}
            minWidth={10}
            sx={{ border: "1px solid" }}
          ></Grid>
        </Grid>
      </Toolbar>
      <Toolbar sx={{ width: "90%", m: "0 auto" }}>
        <Grid
          container
          display="flex"
          minHeight={10}
          justifyContent="center"
          alignItems="center"
        >
          <Typography sx={{ color: "#b6b6b6", fontSize: "1px" }}>
            Make your exporting easy!
          </Typography>
        </Grid>
      </Toolbar>
    </>
  );
};

export default Footer;
